const styles = document.createElement("style")
styles.innerHTML = `
  @-webkit-keyframes squish {
    0% { -webkit-transform: scaleY(1) rotate(3deg); }
    25% { -webkit-transform: scaleY(0.8) rotate(0deg); }
    50% { -webkit-transform: scaleY(1) rotate(-3deg); }
    75% { -webkit-transform: scaleY(0.8) rotate(0deg); }
    100% { -webkit-transform: scaleY(1) rotate(3deg); }
  }

  .squish {
    -webkit-animation-name: squish;
    -webkit-animation-duration: 0.5s;
    -webkit-transform-origin:50% 50%;
    -webkit-animation-iteration-count: infinite;
  }

  @-webkit-keyframes squish-flipped {
    0% { -webkit-transform: scaleY(1) scaleX(-1) rotate(3deg); }
    25% { -webkit-transform: scaleY(0.8) scaleX(-1) rotate(0deg); }
    50% { -webkit-transform: scaleY(1) scaleX(-1) rotate(-3deg); }
    75% { -webkit-transform: scaleY(0.8) scaleX(-1) rotate(0deg); }
    100% { -webkit-transform: scaleY(1) scaleX(-1) rotate(3deg); }
  }

  .squish-flipped {
    -webkit-animation-name: squish-flipped;
    -webkit-animation-duration: 0.5s;
    -webkit-transform-origin:50% 50%;
    -webkit-animation-iteration-count: infinite;
  }


  #floating-image {
    position: absolute;
    z-index: 1000;
    pointer-events: none;
  }
`
document.body.appendChild(styles)


setTimeout(() => {

  let imageSize = Math.floor(Math.random() * (20 - 3) + 3)
  let imageURL = 'data:image/gif;base64,';

  const element = `
    <img id="floating-image" src=${imageURL} style="width: ${imageSize}em"/>
  `

  // 
  const init = () => {

    //    
    $('body').append(element);

    //   
    $(document).mousemove((event) => {

      let image = $('#floating-image');

      $('#floating-image').stop().animate({
        left: event.pageX,
        top: event.pageY - image.height() / 2
      }, {
        step: () => {
          //image.addClass('squish-flipped');
          if (image.get()[0].x > event.pageX) {
            image.removeClass('squish-flipped');
            image.addClass('squish')
          } else {
            image.removeClass('squish');
            image.addClass('squish-flipped')
          }
        },
        complete: () => {
          image.removeClass('squish-flipped');
          image.removeClass('squish');
        }
      })
    })
  }

  init();

}, 1000);